import { reviews } from "../assets/imagenes/apis/data"

export default function Reviews() {
  return (
    <article >
        <h2></h2>
        <div className="art-review">
          <div className="box-review-center">
            {reviews.map((item, index)=>(
            <div key={index} className="card-review">
                <span>{item.calificacion}</span>
                <h2>{item.nombre}</h2>
                <p>{item.descripcion}</p>
                <p>{item.fecha}</p>
            </div>
            ))}
          </div>
        </div>
    </article>
  )
}
